import React from "react"
import {Card} from '@material-ui/core'
import HttpService from '../../services/HttpService'

function ContactCard(props){
    console.log(props)

    function DisableButtons(){
        //Get list of connections for user disable buttons for people with those connections

    }

    function HandleConnection(){
        //Create new connection for button press!
        const http = new HttpService();
        let create_connections_url = "user/create-connection";
        let get_connections_url = "user/get-connected-users";
        const tokenId = "user-token";
        let postInfo = JSON.stringify({ email: props.thisUser.email , emailRec: props.user.email });

        http.postData(postInfo, create_connections_url,tokenId).then(data=>{
            console.log(JSON.stringify(data));
        }).catch((error)=> {
            console.log(error)
            return error; 
            });

        return http.getData(get_connections_url,tokenId).then(data=>{
            console.log(JSON.stringify(data));
            props.updateConnections(
                {
                    connections: data.result
                }
            )
            return data;
        }).catch((error)=> {
            console.log(error)
            return error; 
            });

    }
    return (
        <div>
        <br></br>
        <Card>
            <div className='rowC'>
                {props.user.name}
                <button onClick = {HandleConnection}>Connect</button>
            </div>
        </Card>
        <br></br>
        </div>
    )
}

export default ContactCard
